import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Navigate, Route, Switch } from "react-router-dom";
import Login from "./view/auth/Login";
import Header from "./view/header/Header";
import Signup from "./view/auth/Signup";
import axios from "axios";
import PrivateRoute from "./view/routing/PrivateRoute";

axios.defaults.baseURL = "https://groceryshop-api.herokuapp.com/api/";
axios.defaults.headers.post["Content-Type"] = "application/json";
function App() {
  const token = localStorage.getItem("user.token");

  return (
    <BrowserRouter>
      <Switch>
        <Route path="/login" component={Login} />
        <PrivateRoute path="/" component={Header} exact />
        <Route path="/signup" component={Signup} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
